class Rock {
  final int rockId;
  final double price;
  final String size;
  final int rating;
  final double humidity;
  final String temperature;
  final String category;
  final String rockName;
  final String imageURL;
  bool isFavorited;
  final String description;
  bool isSelected;
  final String formula;
  final double hardness;
  final String color;
  final bool isMagnetic;

  //add fields
  final String healthRisks;
  final List<Map<String, String>> askedQuestions;
  final String crystalSystem;
  final String colors;
  final String luster;
  final String diaphaneity;
  final String quimicalClassification;
  final String elementsListed;
  final String healingPropeties;
  final String formulation;
  final String meaning;
  final String howToSelect;
  final String types;
  final String uses;

  //collection fields
  final String dateAcquired;
  final double cost;
  final String locality;
  final double length;
  final double width;
  final double height;
  final String notes;
  final String unitOfMeasurement;
  final List<RockImage> rockImages;

  Rock({
    required this.rockId,
    required this.price,
    required this.category,
    required this.rockName,
    required this.size,
    required this.rating,
    required this.humidity,
    required this.temperature,
    required this.imageURL,
    required this.isFavorited,
    required this.description,
    required this.isSelected,
    required this.formula,
    required this.hardness,
    required this.color,
    required this.isMagnetic,
    required this.healthRisks,
    required this.askedQuestions,
    required this.crystalSystem,
    required this.colors,
    required this.luster,
    required this.diaphaneity,
    required this.quimicalClassification,
    required this.elementsListed,
    required this.healingPropeties,
    required this.formulation,
    required this.meaning,
    required this.howToSelect,
    required this.types,
    required this.uses,
    this.cost = 0.0,
    this.dateAcquired = '',
    this.height = 0.0,
    this.length = 0.0,
    this.locality = '',
    this.notes = '',
    this.unitOfMeasurement = '',
    this.width = 0.0,
    this.rockImages = const [],
  });

  factory Rock.empty() => Rock(
        rockId: 0,
        price: 0.0,
        category: '',
        rockName: '',
        size: '',
        rating: 0,
        humidity: 0.0,
        temperature: '',
        imageURL: '',
        isFavorited: false,
        description: '',
        isSelected: false,
        formula: '',
        hardness: 0.0,
        color: '',
        isMagnetic: false,
        healthRisks: '',
        askedQuestions: [],
        crystalSystem: '',
        colors: '',
        luster: '',
        diaphaneity: '',
        quimicalClassification: '',
        elementsListed: '',
        healingPropeties: '',
        formulation: '',
        meaning: '',
        howToSelect: '',
        types: '',
        uses: '',
      );

  Map<String, dynamic> toMap() {
    return {
      'rockId': rockId,
      'price': price,
      'category': category,
      'rockName': rockName,
      'size': size,
      'rating': rating,
      'humidity': humidity,
      'temperature': temperature,
      'imageURL': imageURL,
      'isFavorited': isFavorited ? 1 : 0,
      'description': description,
      'isSelected': isSelected ? 1 : 0,
      'formula': formula,
      'hardness': hardness,
      'color': color,
      'isMagnetic': isMagnetic ? 1 : 0,
      'cost': cost,
      'dateAcquired': dateAcquired,
      'height': height,
      'length': length,
      'locality': locality,
      'notes': notes,
      'unitOfMeasurement': unitOfMeasurement,
      'width': width,
    };
  }

  // Implement a fromMap method to convert a Map into a Rock object.
  factory Rock.fromMap(Map<String, dynamic> map) {
    return Rock(
      rockId: map['rockId'] ?? 0,
      price: map['price'] ?? 0,
      category: map['category'] ?? '',
      rockName: map['rockName'] ?? '',
      size: map['size'] ?? '',
      rating: map['rating'] ?? 0,
      humidity: map['humidity'] ?? 0,
      temperature: map['temperature'] ?? '',
      imageURL: map['imageURL'] ?? '',
      isFavorited: (map['isFavorited'] ?? 0) == 1,
      description: map['description'] ?? '',
      isSelected: (map['isSelected'] ?? 0) == 1,
      formula: map['formula'] ?? '',
      hardness: map['hardness'] ?? 0,
      color: map['color'] ?? '',
      isMagnetic: (map['isMagnetic'] ?? 0) == 1,
      healthRisks: map['healthRisks'] ?? '',
      askedQuestions: map['askedQuestions'] ?? [],
      crystalSystem: map['crystalSystem'] ?? '',
      colors: map['colors'] ?? '',
      luster: map['luster'] ?? '',
      diaphaneity: map['diaphaneity'] ?? '',
      quimicalClassification: map['quimicalClassification'] ?? '',
      elementsListed: map['elementsListed'] ?? '',
      healingPropeties: map['healingPropeties'] ?? '',
      formulation: map['formulation'] ?? '',
      meaning: map['meaning'] ?? '',
      howToSelect: map['howToSelect'] ?? '',
      types: map['types'] ?? '',
      uses: map['uses'] ?? '',
      cost: map['cost'] ?? 0.0,
      dateAcquired: map['dateAcquired'] ?? '',
      height: map['height'] ?? 0.0,
      length: map['length'] ?? 0.0,
      locality: map['locality'] ?? '',
      notes: map['notes'] ?? '',
      unitOfMeasurement: map['unitOfMeasurement'] ?? '',
      width: map['width'] ?? 0.0,
    );
  }

  static Rock? rockListFirstWhere(int id) {
    try {
      return rockList.firstWhere((element) => element.rockId == id);
    } catch (e) {
      return null;
    }
  }

